import React from "react";
import Card from "./Card";

const CardContainer = (props) => {
  // console.log(props.foxes)
  return <div className="card-container" onClick={(e) => props.handleShowClick(props.fox) }>
    {props.foxes.map((fox => {
      return <Card fox={fox} key={fox.id} />
    }))}
  </div>;
};

export default CardContainer;
